import React from 'react';
import { View, Text, TouchableOpacity, StyleSheet } from 'react-native';

const Auctions = () => {
    return (
        <View style={styles.container}>
            {/* Header */}
            <View style={styles.header}>
                <Text style={styles.title}>Auktionen</Text>
            </View>

            {/* Erste Leiste mit Buttons */}
            <View style={styles.buttonsContainer}>
                {["Allgemein", "Bieten", "Kaufaufträge", "Exponate", "Anforderungen"].map((button, index) => (
                    <TouchableOpacity key={index} style={styles.button}>
                        <Text style={styles.buttonText}>{button}</Text>
                    </TouchableOpacity>
                ))}
            </View>

            {/* Information-Leiste */}
            <View style={styles.infoContainer}>
                <Text style={styles.infoText}>Information</Text>
            </View>

            {/* Hauptbereich */}
            <View style={styles.mainContent}></View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        padding: 20,
    },
    header: {
        flexDirection: "row",
        justifyContent: "space-between",
        alignItems: "center",
        marginBottom: 20,
    },
    title: {
        color: 'rgba(240,175,77,1)',
        fontWeight: 'bold',
        fontSize: 50,
    },
    buttonsContainer: {
        flexDirection: 'row',
        backgroundColor: 'rgb(247,203,105)',
        height: 50,
        alignItems: 'center',
        marginBottom: 10, // Abstand zur Information-Leiste
    },
    button: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    buttonText: {
        fontWeight: 'bold',
        color: 'black',
    },
    infoContainer: {
        backgroundColor: 'rgb(247,203,105)',
        height: 50,
        justifyContent: 'center',
        alignItems: 'center',
        marginBottom: 0, // Direkt an die orange Box anschließend
    },
    infoText: {
        fontWeight: 'bold',
        color: 'black',
        textAlign: 'center',
    },
    mainContent: {
        flex: 1,
        backgroundColor: 'rgb(253,241,219)',
    },
});

export default Auctions;
